import React from 'react';

class Contact extends React.Component {
    render() {
        return(
            <div class="contact">
                <button class="button">
                    <div class="displayname">{this.props.displayName}</div>
                    <div class="message">{this.props.lastMessage}</div>
                </button>
            </div>
        );
    }
}

export default Contact;
